<p>My idea is return a ranking of  values from the field array (<code>tags</code>). I could achieve the list the sum of values but I can not sort it...</p>

<p>This is the query that I could do and it seems that it works:</p>

<pre><code>db.getCollection("metadata").aggregate(
{$unwind: '$tags'},
{$group: {_id:'$tags.name', total: {$sum: 1}}}
);
</code></pre>

