MongoDB Query SubDocuments by field valeu<p>So I have this schema for a Supplier:</p>

<pre><code> /**
 * Module dependencies.
 */
var mongoose = require('mongoose'),
    Address = require('./Address.js'),
    AddressSchema = mongoose.model('Address').schema,
    Product = require('./Product.js'),
    ProductSchema = mongoose.model('Product').schema;

// Create a new schema for the reviews collection with all the relevant information for a review
var Schema = mongoose.Schema;

var Supplier = new Schema(
    {
        name: String,
        address: AddressSchema,
        location: {
            type: {type:String, default: 'Point'},
            coordinates: [Number] // [&lt;longitude&gt;, &lt;latitude&gt;]
        },
        products: [ProductSchema]
    }
);

Supplier.index({location: '2dsphere'});

var SupplierModel = mongoose.model('Supplier', Supplier );
// export the review model
module.exports = SupplierModel;
</code></pre>

<p>Products in my system have a "verified" field which is a boolean. In one of my routes I would like to query the DB to find all the suppliers which have products which aren't verified such that I can then render those products in the page.</p>

<p>I tried this, but unofrtunatelly it returns all the subdocuments no matter if "verified" is true or false:</p>

<pre><code>exports.admin_accept_product_get = function (req, res) {
    Supplier.find({'products.verified' : false}, function(err, docs) {
        res.render('admin_accept_product', { user : req.user, suppliers: docs });
    });
};
</code></pre>

<p>Any help is appreciated</p>

<p>Edit:</p>

<p>The previous query would return the following data:</p>

<pre><code>{
    "_id" : ObjectId("5b2b839a2cf8820e304d7413"),
    "location" : {
        "type" : "Point",
        "coordinates" : [ 
            -16.5122377, 
            28.4028329
        ]
    },
    "name" : "Tienda1",
    "products" : [ 
        {
            "verified" : true,
            "_id" : ObjectId("5b2b83d32cf8820e304d7420"),
